  \"2016-07-27T22:21:12.032270\",\n\t\"name\": \"water-management-plan-1983\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Refuge Objectives 1. To provide a diversity
  of wetland habitats. 2. To provide ideal conditions for canvasback and redhead production
  and maintenance. 3. To provide habitat for the production and maintenance of other
  waterfowl and migratory birds, and other wildlife. 4. To provide educational and
  recreational use of the refuge where compatible with objectives 1-3. Management
  Strategies: Current water management priorities are concentrated on objectives 1-3.
  Water management for objective 4 has received very low priority since the early
  1970's. These priority rankings will not change. Fish populations will also be considered
  in management decisions. Maintenance of optimum nesting habitat for canvasbacks
  and redheads dictates the water management program for the refuge. In this regard
  water management in the South Sump should achieve: !)optimum water levels for maximum
  nesting habitat, 2)stable or slowly decreasing levels during the nesting season,
  and 3)optimum growing conditions for sago pondweed, dense bulrush stands and macroinvertebrates.
  Once the desired spring level in the South Sump is reached, water will be spread
  to other parts of the refuge, especially the North Sump.\",\n\t\"license_title\":
